import React from 'react';
import { Nav , NavBarContainer,NavBarLogo } from './NavbarElements';

const Navbar = () => {
    return (
        <>
            <Nav>
                <NavBarContainer>
                    <NavBarLogo to='/'>funko!</NavBarLogo>
                </NavBarContainer>
            </Nav>
        </>
    )
}

export default Navbar;
